#Functions



def popup():
    #Window creation
    jan2 = Toplevel()
    jan2.title("Adicionar Afazeres")
    jan2.geometry("400x200")
    jan2.resizable(False, False)
    jan2.transient(mainj)
    jan2.focus_force()
    jan2.grab_set()
    #InsideFunctions
    def voltar():
        jan2.destroy()
    def enter():
        temp = en_afazer.get()
        print(temp + " foi enviado para o banco de dados!")
        adicionar([temp])
        att()
        jan2.destroy()



    #Label
    lb_bg2 = Label(jan2, image=img_jan2bg)
    lb_bg2.pack()
    en_afazer = Entry(jan2, bd=2, font=("Calibri 12 bold"), justify=CENTER)
    en_afazer.place(width=286, height=21, x=57, y=65)

    #buttons
    b_enter = Button(jan2, image=img_benter, borderwidth=0, bd=0, command=enter)
    b_enter.place(width=84, height=31, x=57, y=100)
    b_voltar = Button(jan2, image=img_bvoltar, borderwidth=0, bd=0, command=voltar)
    b_voltar.place(width=84, height=31, x=260, y=100)

def att():
    lb_li.delete(0, END)
    teste = atualizar()
    print(teste)
    for item in teste:
        lb_li.insert(END,item[1])
    
def apagar():
    selec = lb_li.curselection()[0]
    temp = lb_li.get(selec)
    teste = atualizar()

    for item in teste:
        if temp == item[1]:
            remover([item[0]])
    att()

#Buttons

b_new = Button(mainj, image=img_bnew, borderwidth=0, command=popup)
b_new.place(width=84, height=31, x=29, y = 160)

b_del = Button(mainj, image=img_bdel, borderwidth=0, command=apagar)
b_del.place(width=84, height=31, x=29, y = 225)


b_save = Button(mainj, image=img_bsave, bd=0, borderwidth=0, command=att)
b_save.place(width=84, height=31, x=29, y = 290)


b_mode = Button(mainj, image=img_bmode, bd=0, borderwidth=0)
